import Modal from 'react-modal';

function CustomModal( props ) {

    const customStyles = {
        content: {
            width: '150px',
            height: '150px',
            top: '50%',
            left: '50%',
            right: 'auto',
            bottom: 'auto',
            marginRight: '-50%',
            transform: 'translate(-50%, -50%)',
        },
    };

    return (
        <Modal 
            isOpen={props.isOpen}
            style={customStyles}
        >
            <h2>Could not find any group of players matching the input. Are you sure that you have entered the correct values?</h2>
        </Modal>
    )
}

export default CustomModal;
